'El Bugatti Chiron es un hiperdeportivo de Bugatti, que reemplazó al Bugatti Veyron en 2016. El Bugatti Chiron se caracteriza por ser el vehículo más rápido del mundo, siendo capaz de sobrepasar los 490 kilómetros por hora. Es un vehículo revolucionario, más avanzado en todos sus aspectos que su antecesor, pero sin emplear tecnologías híbridas o una construcción rompedora. Cuenta con un impresionante motor W16 de 8 litros en posición central, con 1500 CV, que le permite hacer el 0-100 km/h en 2,5 segundos. El precio del Bugatti Chiron es de 2,4 millones de euros y se fábrica en la factoría de Molsheim, Francia, de forma prácticamente artesanal.','Azul','Bugatti','Chiron','2021','6238934934','contact@bugatti.com');
